  constructor() {}
  userDetail: any = [
    {
      username: 'Karthik Devendra Rao',
      password: 'Karthik@123',
    },
  ];
  logedInUser: any = {};
  isRulesShowedtoUser: boolean = false;
  isUserPlayingGame: boolean = false;
}
